import React, {Component} from 'react';
import './report.css'
import Table from 'react-bootstrap/Table';
import { ColorRing } from  'react-loader-spinner'


class StaticReport extends Component {
  render(){
  const { DataisLoaded, items } = this.props;

  if (!DataisLoaded)
    return(
      <div className='container_row'>
        <div className='loader'>
          <ColorRing
            visible={true}
            height="80"
            width="80"
            ariaLabel="blocks-loading"
            wrapperStyle={{}}
            wrapperClass="blocks-wrapper"
            colors={['#00319f', '#2e56b1', '#5c7bc2', '#8aa1d3', '#b2c1e2']}
            />
          </div>
          <div>
          <h1 className="mb-3"> Please wait.... </h1>
        </div>
      </div>)

    return (
        <div className="row justify-content-start border-secondary" style={{margin:'10px'}}>
          {Object.entries(items).map(([key, value]) => {
            return (
              <div className="col-sm-3" >
                <h5 className="table_heading">{key.toUpperCase()}</h5>
                <Table striped bordered hover>
                  <thead>
                    <tr>
                      <th>Name</th>
                      <th>Count</th>
                      <th>Value</th>
                    </tr>
                  </thead>
                  {value.map(element => {
                    return(
                      <tbody>
                        <tr>
                          <td className='table-rows' style={{textAlign: 'left'}}>{element.name}</td>
                          <td className='table-rows'>{element.count}</td>
                          <td className='table-rows'>{element.total_amount.slice(0,-3)}</td>
                        </tr>
                      </tbody>
                    )
                  })}
                </Table>
              </div>
              )})}
        </div>
    );
  }
}

export default StaticReport;
